import React from 'react';
import './App.css';
import logo from './img1.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h1 className="App-h1">Finding Connections in Ancient Syria</h1>
      <table className='App-t1' cell>
        <tr>
          <td>
          <img src={logo} className="App-logo" alt="logo" />
          </td>
          <td>
          <button type="button" className='App-b1'>Explore the Collection</button>
          <button type="button" className='App-b1'>Explore the Collection</button>
          <button type="button" className='App-b1'>Explore the Collection</button>
          <button type="button" className='App-b1'>Explore the Collection</button>
          </td>
        </tr>
      </table>



      </header>
    </div>
  );
}

export default App;
